import './Students.css';


function Students(props){
    console.log(props)
return(
    <div>
        <table border={1} style= {{margin:"auto"}}>
            <thead>
                <tr>
                    <th>Name</th>
                    <th>Class</th>
                    <th>Subject</th>
                    <th>School Name</th>
                    <th>action</th>
                </tr>
                {props.data.map((item,i)=>{
                    return <tr key={i}>
                        <td>{item.name}</td>
                        <td>{item.class}</td>
                        <td>{item.subject} </td>
                        <td>{item.school}</td>
                    </tr>
                })}
            </thead>
            {/* <tr>
                <td>{props.data[0].name}</td>
                <td>2nd</td>
                <td>Maths</td>
                <td>Oxford school</td>
            </tr> */}
        </table>

    </div>
);
}
export default Students;
